(*Unit Testing*)


(* ::Subsection::Closed:: *)
(*PlotDNASequencingAnalysis*)


DefineTests[PlotDNASequencingAnalysis,
	{
		(* Basic Examples *)
		Example[{Basic,"Plot a single DNA sequencing analysis:"},
			PlotDNASequencingAnalysis[Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"]],
			Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]
		],
		Example[{Basic,"Plot multiple DNA sequencing analyses:"},
			PlotDNASequencingAnalysis[{
				Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"],
				Object[Analysis, DNASequencing, "Sample DNASequencing analysis 2"]
			}],
			{Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}],Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]}
		],
		Example[{Basic,"Plot a DNA sequencing analysis packet:"},
			PlotDNASequencingAnalysis[
				AnalyzeDNASequencing[Object[Data,DNASequencing,"Test Object 1 for AnalyzeDNASequencing"],Upload->False]
			],
			Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]
		],

		(* Options *)
		Example[{Options,SequenceErrors,"If the actual sequence is known, supply SequenceErrors with the indices of base-calls corresponding to substitutions, insertions, and deletions to highlight errors:"},
			PlotDNASequencingAnalysis[
				Object[Analysis,DNASequencing,"Sample pGEM standard sequencing analysis"],
				SequenceErrors->{
					substitutionErrorIndices,
					insertionErrorIndices,
					deletionErrorIndices
				}
			],
			Grid[{{Framed[Pane[___], ___]}, {_}}]
		],

		(* Messages *)
		Example[{Messages,"ObjectDoesNotExist","Indicates that the object to plot could not be found in the database:"},
			PlotDNASequencingAnalysis[Object[Analysis,DNASequencing,"Non-existent sequencing object"]],
			$Failed,
			Messages:>{Download::ObjectDoesNotExist}
		],
		Test["Object does not exist errors work for listed inputs:",
			PlotDNASequencingAnalysis[{
				Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"],
				Object[Analysis,DNASequencing,"Non-existent sequencing object"],
				Object[Analysis, DNASequencing, "Sample DNASequencing analysis 2"]
			}],
			{Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}],$Failed,Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]},
			Messages:>{Download::ObjectDoesNotExist}
		],

		(* Unit Tests *)
		Test["AnalyzeDNASequencingAnalysis works on links:",
			PlotDNASequencingAnalysis[Link[Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"]]],
			Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]
		],
		Test["AnalyzeDNASequencingAnalysis is listable on mixed supported input types:",
			PlotDNASequencingAnalysis[{
				Link[Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"]],
				Object[Analysis, DNASequencing, "Sample DNASequencing analysis 2"],
				Download[Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"]]
			}],
			{
				Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}],
				Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}],
				Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]
			}
		],
		Test["Output->Preview returns a valid graphic for single input:",
			PlotDNASequencingAnalysis[Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"],Output->Preview],
			Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]
		],
		Test["Output->Preview returns a valid SlideView for multiple inputs:",
			PlotDNASequencingAnalysis[
				{
					Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"],
					Object[Analysis, DNASequencing, "Sample DNASequencing analysis 2"]
				},
				Output->Preview
			],
			SlideView[{Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}],Grid[{{Framed[Pane[ValidGraphicsP[], ___], ___]}, {_}}]}]
		],
		Test["Output->Options returns a list of resolved plot options for a single input:",
			PlotDNASequencingAnalysis[Object[Analysis, DNASequencing, "Sample DNASequencing analysis 2"],Output->Options],
			{(_Rule|_RuleDelayed)..}
		],
		Test["Output->Options returns a list of resolved plot options for a list of inputs:",
			PlotDNASequencingAnalysis[
				{
					Object[Analysis, DNASequencing, "Sample DNASequencing analysis 1"],
					Object[Analysis, DNASequencing, "Sample DNASequencing analysis 2"]
				},
				Output->Options
			],
			{(_Rule|_RuleDelayed)..}
		],

